import React from 'react';
import './loadeffect.css';

function Loadeffect() {
    return (
        <div className="loadeffectsMain">
            <div className="roatatingContHoldr">
                <div className="dotscontainerload">
                    <div className="circleloadGrean">
                        <div className="dotoneload dotesload" />
                        <div className="dottwoload dotesload" />
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Loadeffect;
